
/*
 * Module dependencies.
 */

var config = require('./config');
var express = require('express');
var routes = require('./routes');
var http = require('http');
var path = require('path');

var app = express();

var db = require('./db');

var allowCrossDomain = function(req, res, next) {
    res.header('Access-Control-Allow-Origin', '*');
    res.header('Access-Control-Allow-Methods', 'GET,PUT,POST,DELETE');
    res.header('Access-Control-Allow-Headers', 'Content-Type');
    next();
}

// all environments
app.set('port', config.port);
app.set('views', path.join(__dirname, 'views'));
app.set('view engine', 'ejs');
app.set(express.bodyParser());
app.use(express.favicon());
app.use(express.logger('dev'));
app.use(express.json());
app.use(express.urlencoded());
app.use(express.methodOverride());
app.use(allowCrossDomain);
app.use(app.router);
app.use(express.static(path.join(__dirname, 'public')));

// development only
if ('development' == app.get('env')) {
    app.use(express.errorHandler());
}

app.get('/', routes.index);
app.post('/makesnapshots', routes.makesnapshots);
app.post('/getsnapshotsforconfirmation', routes.getsnapshotsforconfirmation);
app.post('/confirmsnapshot', routes.confirmsnapshot);
app.post('/compare', routes.compare);

/*
 * MOCK URLS
 */

